import ExpenseItem from "./components/ExpenseItem";

function App() {
  return (
    <div>
      <ExpenseItem date="08-04-2002" title="Asigurare" amount="20" />
      <ExpenseItem date="14-02-2003" title="Vday" amount="1000" />
      <ExpenseItem date="29-10-2014" title="Asigurare" amount="20" />
    </div>
  );
}

export default App;
